import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';

function MapaInterativo() {
  const latInicial = -27.4678; // Example latitude
  const lonInicial = 153.0278;
  const latitude = latInicial;
  const longitude = lonInicial ;// Example longitude
  const locais = [
    { posicao: [latitude, longitude], nota: "Nos conhecemos aqui!" },
    // mais locais
  ];

  return (
    <MapContainer center={[latInicial, lonInicial]} zoom={13} className="h-96 w-full">
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution="&copy; OpenStreetMap contributors"
      />
      {locais.map((local, index) => (
        <Marker key={index} position={local.posicao}>
          <Popup>{local.nota}</Popup>
        </Marker>
      ))}
    </MapContainer>
  );
}
export default MapaInterativo;
